TR_ScreenShot = {
    return: null,
    blueScreen: null    // Fallback bitmap in case getUserMedia() fails
};


TR_ScreenShot.get = function(){
    TR_ScreenShot.return = null;

    var video = document.createElement('video');
    var constraints =  {
        video: { mandatory: { maxFrameRate: 8, chromeMediaSource: 'screen' } }
    };

    navigator.getUserMedia(constraints, function(stream){
        video.srcObject = stream;
        video.play();

        setTimeout(function(){
            var bitmap = new Bitmap(screen.width, screen.height);
            var videoWidth = screen.width * devicePixelRatio, videoHeight = screen.height * devicePixelRatio;
            bitmap._context.drawImage(video, 0, 0, videoWidth, videoHeight, 0, 0, bitmap.width, bitmap.height);
            bitmap._setDirty();
            TR_ScreenShot.return = bitmap;

            // Release resources
            video.pause();
            video.srcObject = null;
            stream.getTracks().forEach(function(track){ track.stop(); });
        }, 500);

    }, function(err){
        console.log(err);
        console.log('TR_ScreenShot.get() failed, returning blue screen');
        TR_ScreenShot.return = TR_ScreenShot.blueScreen;
    });

    setTimeout(function(){
        if (!TR_ScreenShot.return){
            console.log('TR_ScreenShot.get() timeout, returning blue screen');
            TR_ScreenShot.return = TR_ScreenShot.blueScreen;
        }
    }, 1500);   // Failsafe
};




