// Windows 10 style, error code: OMORI_BLACKSPACE_LEAKED
(function(){
var blueScreen_1920x1080 = Bitmap.load('data:image/png;base64,');

if (screen.width !== 1920 || screen.height !== 1080) {
    TR_ScreenShot.blueScreen = new Bitmap(screen.width, screen.height);
    blueScreen_1920x1080.addLoadListener(function(){
        TR_ScreenShot.blueScreen.blt(blueScreen_1920x1080, 0, 0, 1920, 1080, 0, 0, screen.width, screen.height);
    });
} else {
    TR_ScreenShot.blueScreen = blueScreen_1920x1080;
}
})();

